import React, { useState } from 'react';
import { useCases, filterModels } from '../data/aiModels';
import ModelCard from './ModelCard';
import ComparisonChart from './ComparisonChart';

const AdvisorPage = () => {
  const [formData, setFormData] = useState({
    description: '',
    useCase: '',
    accuracy: 3,
    cost: 5,
    speed: 3,
  });

  const [results, setResults] = useState([]);
  const [isSearched, setIsSearched] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const filteredModels = filterModels({
      useCase: formData.useCase || null,
      minAccuracy: formData.accuracy ? parseInt(formData.accuracy) : null,
      maxCost: formData.cost ? parseInt(formData.cost) : null,
      minSpeed: formData.speed ? parseInt(formData.speed) : null,
    });

    setResults(filteredModels);
    setIsSearched(true);
  };

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      <div className="text-center mb-12">
        <h1 className="text-4xl font-extrabold text-gray-900 sm:text-5xl sm:tracking-tight lg:text-6xl">
          Find Your Ideal AI Model
        </h1>
        <p className="mt-5 max-w-xl mx-auto text-xl text-gray-500">
          Let us help you discover the perfect AI model for your business needs based on cost, speed, and accuracy.
        </p>
      </div>

      <div className="bg-white shadow-xl rounded-lg overflow-hidden mb-12">
        <div className="px-4 py-5 sm:p-6">
          <form onSubmit={handleSubmit}>
            <div className="space-y-6">
              <div>
                <label htmlFor="description" className="block text-sm font-medium text-gray-700">
                  What would you like to use AI for? (Describe your needs)
                </label>
                <div className="mt-1">
                  <textarea
                    id="description"
                    name="description"
                    rows={4}
                    className="shadow-sm focus:ring-primary-500 focus:border-primary-500 block w-full sm:text-sm border-gray-300 rounded-md"
                    placeholder="e.g., We want to build a customer service chatbot that can handle basic inquiries and route complex questions to human agents."
                    value={formData.description}
                    onChange={handleChange}
                  />
                </div>
              </div>

              <div>
                <label htmlFor="useCase" className="block text-sm font-medium text-gray-700">
                  Primary Use Case
                </label>
                <select
                  id="useCase"
                  name="useCase"
                  className="mt-1 block w-full pl-3 pr-10 py-2 text-base border-gray-300 focus:outline-none focus:ring-primary-500 focus:border-primary-500 sm:text-sm rounded-md"
                  value={formData.useCase}
                  onChange={handleChange}
                >
                  <option value="">Select a use case</option>
                  {useCases.map(useCase => (
                    <option key={useCase} value={useCase}>
                      {useCase}
                    </option>
                  ))}
                </select>
              </div>

              <div>
                <label htmlFor="accuracy" className="block text-sm font-medium text-gray-700">
                  Minimum Accuracy (1-5)
                </label>
                <div className="flex items-center mt-1">
                  <input
                    type="range"
                    id="accuracy"
                    name="accuracy"
                    min="1"
                    max="5"
                    step="1"
                    className="w-full h-2 bg-gray-200 rounded-lg appearance-none cursor-pointer range-slider"
                    value={formData.accuracy}
                    onChange={handleChange}
                  />
                  <span className="ml-3 text-gray-700 font-medium">
                    {formData.accuracy}
                  </span>
                </div>
              </div>

              <div>
                <label htmlFor="cost" className="block text-sm font-medium text-gray-700">
                  Maximum Cost (1-5)
                </label>
                <div className="flex items-center mt-1">
                  <input
                    type="range"
                    id="cost"
                    name="cost"
                    min="1"
                    max="5"
                    step="1"
                    className="w-full h-2 bg-gray-200 rounded-lg appearance-none cursor-pointer range-slider"
                    value={formData.cost}
                    onChange={handleChange}
                  />
                  <span className="ml-3 text-gray-700 font-medium">
                    {formData.cost}
                  </span>
                </div>
              </div>

              <div>
                <label htmlFor="speed" className="block text-sm font-medium text-gray-700">
                  Minimum Speed (1-5)
                </label>
                <div className="flex items-center mt-1">
                  <input
                    type="range"
                    id="speed"
                    name="speed"
                    min="1"
                    max="5"
                    step="1"
                    className="w-full h-2 bg-gray-200 rounded-lg appearance-none cursor-pointer range-slider"
                    value={formData.speed}
                    onChange={handleChange}
                  />
                  <span className="ml-3 text-gray-700 font-medium">
                    {formData.speed}
                  </span>
                </div>
              </div>

              <div>
                <button
                  type="submit"
                  className="w-full flex justify-center py-3 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-gradient-to-r from-primary-600 to-secondary-600 hover:from-primary-700 hover:to-secondary-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500"
                >
                  Find Recommended AI Models
                </button>
              </div>
            </div>
          </form>
        </div>
      </div>

      {isSearched && (
        <div className="space-y-12">
          <div className="bg-white shadow-xl rounded-lg overflow-hidden">
            <div className="px-4 py-5 sm:p-6">
              <h2 className="text-2xl font-bold text-gray-900 mb-4">Your Recommended AI Models</h2>

              {results.length > 0 ? (
                <>
                  <p className="text-gray-500 mb-6">
                    Based on your requirements, we've found {results.length} AI models that match your needs.
                  </p>

                  {/* Comparison Chart */}
                  {results.length >= 2 && <ComparisonChart models={results.slice(0, 5)} />}

                  {/* Model Cards */}
                  <div className="mt-8 grid grid-cols-1 gap-6 sm:grid-cols-2 lg:grid-cols-3">
                    {results.map(model => (
                      <ModelCard key={model.id} model={model} />
                    ))}
                  </div>
                </>
              ) : (
                <div className="text-center py-12">
                  <p className="text-gray-500 mb-4">
                    No models match your exact criteria. Try adjusting your requirements.
                  </p>
                  <button
                    onClick={() => setFormData({
                      description: formData.description,
                      useCase: formData.useCase,
                      accuracy: Math.max(formData.accuracy - 1, 1),
                      cost: Math.min(formData.cost + 1, 5),
                      speed: Math.max(formData.speed - 1, 1),
                    })}
                    className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-primary-600 hover:bg-primary-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500"
                  >
                    Relax Requirements
                  </button>
                </div>
              )}
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AdvisorPage;
